import React from 'react'

const Auth = () => {
  return (
    <div className="grid grid-cols-4">
        <div className='mx-auto col-start-2 col-end-4 text-teal-400'>
            <div className="rounded-sm bg-slate-200">
                Lol david
            </div>
        </div>
    </div>
  )
}

export default Auth
